// ==UserScript==
// @name           govno
// @version	   2
// @description    govno userscript
// @include        http://2-ch.ru/*
// @include        http://*.2-ch.ru/*
// @exclude        */src/*
// ==/UserScript==

var nullcheck = ([ //kusaba-liek boards
	'0chan.ru',
	'gchan.ru',
	'gaychan.ru',
	'apple.su',
	'02-ch.ru',
	'410chan.ru'
		].indexOf(location.host.replace('www.','')) == -1),
dobrocheck    = ([ //boards without <div id="thread...">
	'2-ch.ru',
	'nowere.net',
	'img.4chan.org',
	'zip.4chan.org',
	'orz.4chan.org',
	'cgi.4chan.org'
		].indexOf(location.host.replace('www.','')) == -1),
scripts = [ //dobroscripts base64 collection. //WARNING order important!
	//0chan.js
	'data:text/javascript;base64,',
	//0dobrofix.js
	'data:text/javascript;base64,',
	//2ch-profit.js
	'data:text/javascript;base64,',
	//base64.js
	'data:text/javascript;base64,',
	//ch-alib.js
	'data:text/javascript;base64,',
	//ch-fixlinks.js
	'data:text/javascript;base64,',
	//ch-flash.js
	'data:text/javascript;base64,',
	//ch-images.js
	'data:text/javascript;base64,',
	//ch-opposts.js
	'data:text/javascript;base64,',
	//ch-posts.js
	'data:text/javascript;base64,',
	//ch-threads.js
	'data:text/javascript;base64,',
	//svistoperdelki.js
	'data:text/javascript;base64,',
''];

//inject scripts to document namespace
if(docHead = document.getElementsByTagName('head')[0]) {
	var elt, len = scripts.length - 1;
	for(var i in scripts) {
		if(i == 0 && nullcheck)
			continue;
		if(i == 1 && dobrocheck)
			continue;
		if(i == len) break;
		elt = document.createElement('script');
		elt.type = 'text/javascript';
		elt.src = scripts[i];
		docHead.appendChild(elt);
	}
}